import React from "react";
import web from "../src/images/landing.png";
import Common from "./Common";
import Aos from "aos";

const Home = () => {
  return (
    <>
      <div data-aos="fade-up">
        <Common
          name="Grow your business with"
          imgsrc={web}
          visit="/service"
          btname="Get Started"
        />
      </div>
    </>
  );
};

export default Home;
